import React from "react";

export default function Card({ data }) {
  console.log(data);
  return data.map((item) => {
    const imagem = `https://image.tmdb.org/t/p/w500/${item?.backdrop_path}`;
    return (
      <div>
        <img src={imagem} />
        <h2>{item?.original_title}</h2>
        <p></p>
      </div>
    );
  });
}
